@52:20 I just want to point out that back then governments realized that to get farmhands into factories they needed literacy. Most farmhands were illiterate, but a factory worker needs to be able to read charts, instructions, etc. So both the rich and governments created public education to guarantee competent workers for the factories. Thus the industrial revolution was a success. 

Today the EXACT OPPOSITE is happening. AI, robots in factories still need humans to operate them, repair them, and manage them. But our current rich and governments are shutting down public schools and vilifying higher education, instead of training the workforce for AI and robot management. And I don't understand why. Instead of preparing the population with access to education to these new technology, they are harping on about tariffs, DEI, wokeness, absurd nonsense that has nothing to do with the changing economics and technology. 

Worse, the media and too many podcasters like Joe Rogan, are going along with it, instead of criticizing it. So unlike the 19th century where the industrial revolution made everyone rich because governments recognized the need to educate the populations to the new normal, the current Digital Revolution will make us look like 3rd world countries. Why are 3rd world countries 3rd world? Because none of them educated their populations to compete with the 1st world. Except China. Now instead of doing what China did, we're doing what Somalia did. Going backwards, while tech moves forwards.
